    public override void WaitTillWorkQueueEntryTableIsEmptyOrThrow()
    {
        for (int i = 0; i < 100; i++)
        {
            if (GetWorkQueueEntryCount() == 0)
            {
                return;
            }
            Thread.Sleep(500);
        }

        throw new Exception("WorkQueueEntry table is not empty after timeout");
    }

    public override void SetupQueue(Guid queueId, Guid retryType, int maxRetries,
        int retryIntervalSeconds, Guid? errorQueueId)
    {
        string refError = errorQueueId.HasValue
            ? $"'{errorQueueId.Value}'"
            : "NULL";

        dataService.ExecuteSql($@"
            UPDATE ""WorkQueue""
            SET ""refWorkQueueRetryTypeId"" = '{retryType}',
                ""RetryIntervalSeconds""   = {retryIntervalSeconds},
                ""MaxRetries""            = {maxRetries}
            WHERE ""Id"" = '{queueId}';

            UPDATE ""WorkQueueCommand""
            SET ""refErrorWorkQueueId"" = {refError}
            WHERE ""Command"" = 'Execute_FailingWorkQueueTest'
              AND ""refWorkQueueId"" = '{queueId}';
            ");
    }

    public override void CreateWorkQueueModificationTrigger()
    {
        var batch = @"
            DROP TABLE IF EXISTS ""TestWorkQueueEntryModifications"";

            CREATE TABLE ""TestWorkQueueEntryModifications"" (
                ""refEntryId"" UUID NOT NULL REFERENCES ""WorkQueueEntry"" (""Id""),
                ""refQueueId"" UUID NOT NULL REFERENCES ""WorkQueue"" (""Id""),
                ""NumberOfExecutionsInWorkQueue"" INT NOT NULL
            );

                CREATE OR REPLACE FUNCTION trg_update_workqueue_entry()
                RETURNS TRIGGER AS $$
                BEGIN
                    IF EXISTS (
                        SELECT 1 FROM ""TestWorkQueueEntryModifications""
                        WHERE ""refEntryId"" = NEW.""Id""
                          AND ""refQueueId"" = NEW.""refWorkQueueId""
                    ) THEN
                        UPDATE ""TestWorkQueueEntryModifications""
                        SET ""NumberOfExecutionsInWorkQueue"" = NEW.""AttemptCount""
                        WHERE ""refEntryId"" = NEW.""Id""
                          AND ""refQueueId"" = NEW.""refWorkQueueId"";
                    ELSE
                        INSERT INTO ""TestWorkQueueEntryModifications"" (
                            ""refEntryId"", ""refQueueId"", ""NumberOfExecutionsInWorkQueue""
                        ) VALUES (NEW.""Id"", NEW.""refWorkQueueId"", NEW.""AttemptCount"");
                    END IF;
                    RETURN NEW;
                END;
                $$ LANGUAGE plpgsql;

                DROP TRIGGER IF EXISTS ""TR_Test_WorkQueueEntry_Updated"" ON ""WorkQueueEntry"";

                CREATE TRIGGER ""TR_Test_WorkQueueEntry_Updated""
                AFTER UPDATE ON ""WorkQueueEntry""
                FOR EACH ROW
                EXECUTE PROCEDURE trg_update_workqueue_entry();
                ";
        dataService.ExecuteSql(batch);
    }

    public override Dictionary<Guid, int> GetAttemptCountsInQueues(Guid entryId)
    {
        string sql = $@"
            SELECT ""refQueueId"", ""NumberOfExecutionsInWorkQueue""
            FROM ""TestWorkQueueEntryModifications""
            WHERE ""refEntryId"" = '{entryId}';
            ";
        var res = dataService.ExecuteSql(sql);
        var regex = new Regex(@"([0-9a-fA-F\-]{36})\s*\s*(\d+)\s*\n");
        var dict = new Dictionary<Guid, int>();
        foreach (Match m in regex.Matches(res))
        {
            dict[new Guid(m.Groups[1].Value)] = int.Parse(m.Groups[2].Value);
        }
        return dict;
    }

    public override void DeleteWorkQueueModificationTrigger()
    {
        dataService.ExecuteSql(@"
            DROP TRIGGER IF EXISTS ""TR_Test_WorkQueueEntry_Updated"" ON ""WorkQueueEntry"";
            DROP FUNCTION IF EXISTS trg_update_workqueue_entry();
            DROP TABLE IF EXISTS ""TestWorkQueueEntryModifications"";
            ");
    }

